tables.table_schema:
CREATE TABLE ClimateData (
  id INT PRIMARY KEY,
  temperature FLOAT,
  humidity FLOAT,
  rainfall FLOAT
);

CREATE TABLE AgroforestryClimateData (
    id INT PRIMARY KEY,
    location VARCHAR(50),
    temperature FLOAT,
    humidity FLOAT
);

CREATE TABLE AgroforestryPractices (
    id INT PRIMARY KEY,
    practice_name VARCHAR(50),
    description TEXT,
    implemented_by VARCHAR(50)
);

CREATE TABLE climate_data (
    id INT PRIMARY KEY,
    temperature FLOAT,
    rainfall FLOAT,
    date DATE
);

CREATE TABLE agroforestry_practices (
    practice_id INT PRIMARY KEY,
    practice_name VARCHAR(50),
    description TEXT
);

CREATE TABLE Climate_Data (
    data_id INT PRIMARY KEY,
    temperature FLOAT,
    humidity FLOAT,
    rainfall FLOAT
);

CREATE TABLE Agroforestry_Practices (
    practice_id INT PRIMARY KEY,
    practice_name VARCHAR(50),
    tree_species VARCHAR(50),
    planting_date DATE
);

CREATE TABLE Farmers (
    farmer_id INT PRIMARY KEY,
    farmer_name VARCHAR(50),
    location VARCHAR(100),
    contact_number VARCHAR(15)
);

CREATE TABLE Soil_Data (
    soil_id INT PRIMARY KEY,
    soil_type VARCHAR(50),
    acidity_level FLOAT,
    fertility VARCHAR(20)
);

CREATE TABLE Harvest_Data (
    harvest_id INT PRIMARY KEY,
    crop_name VARCHAR(50),
    yield_quantity FLOAT,
    harvest_date DATE
);
